import React from 'react';
import ReactDOM from 'react-dom';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import { Card, CardImg, CardText, CardBody, CardTitle, CardSubtitle, CardLink } from 'reactstrap';
import Button from 'react-bootstrap/Button';
import MaterialIcons from 'material-icons-react';
import Figure from 'react-bootstrap/Figure';
import Header from './Components/Header';
import Footer from './Components/Footer';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Table from 'react-bootstrap/Table';
import Tabs from 'react-bootstrap/Tabs';
import Tab from 'react-bootstrap/Tab'
import Sweetalert from 'react-bootstrap-sweetalert';

class ModeratorSingleJob extends React.Component {
  render() {
    return(
      <Container style = {{marginTop: "20vh", padding: 0}}>
        <Card width = "10">
          <CardBody>
            <CardTitle>Job Title: <CardLink href = "#">{item.jobTitle}</CardLink></CardTitle>
            <CardText>Job Description: {item.jobDescription}</CardText>
            <CardText>Company Name: {item.jobCompanyName}</CardText>
            <CardText>Deadline: {item.jobDeadline}</CardText>
            <CardText>Location</CardText>
            <CardText>Posted by</CardText>
              <div>
                  <Button className="float-left">Edit</Button>&nbsp;
                  <Button>Delete</Button>
              </div>
          </CardBody>
        </Card>
      </Container>
    )
  }
}

export default ModeratorSingleJob;
